INSERT INTO `faqs` (`id`, `slug`, `category`, `question`, `answer`, `pricing`, `created_at`) VALUES
(1, 'google-tag-manager-pixel', 'pixels', 'Google Tag Manager Pixel', '<p>Google Tag Manager allows you to combine hundreds of pixels into a single pixel. Please make sure to add the correct &quot;Container ID&quot; otherwise events will not be tracked!</p><p><code>e.g. GTM-ABC123DE</code></p><p><a href=\"https://marketingplatform.google.com/about/tag-manager/\" target=\"_blank\">Learn more</a></p>', 0, '2022-06-15 21:13:09'),
(2, 'facebook-pixel', 'pixels', 'Facebook Pixel', '<p>Facebook pixel makes conversion tracking, optimization and remarketing easier than ever. The Facebook pixel ID is usually composed of 16 digits. Please make sure to add the correct value otherwise events will not be tracked!</p> <p><code>e.g. 1234567890123456</code></p><p><a href=\"https://www.facebook.com/business/a/facebook-pixel\" target=\"_blank\">Learn more</a></p>', 0, '2022-06-15 21:13:09'),
(3, 'google-adwords-conversion-pixel', 'pixels', 'Google Adwords Conversion Pixel', '<p>With AdWords conversion tracking, you can see how effectively your ad clicks lead to valuable customer activity. The Adwords pixel ID is usually composed of AW followed by 11 digits followed by 19 mixed characters. Please make sure to add the correct value otherwise events will not be tracked!</p><p><code>e.g. AW-12345678901/ABCDEFGHIJKLMOPQRST</code></p><p><a href=\"https://support.google.com/adwords/answer/1722054?hl=en\" target=\"_blank\">Learn more</a></p>', 0, '2022-06-15 21:13:09'),
(4, 'linkedin-insight-pixel', 'pixels', 'LinkedIn Insight Pixel', '<p>The LinkedIn Insight Tag is a piece of lightweight JavaScript code that you can add to your website to enable in-depth campaign reporting and unlock valuable insights about your website visitors. You can use the LinkedIn Insight Tag to track conversions, retarget website visitors, and unlock additional insights about members interacting with your ads.!</p><p><code>e.g. 123456</code></p><p><a href=\"https://www.linkedin.com/help/linkedin/answer/65521\" target=\"_blank\">Learn more</a></p>', 0, '2022-06-15 21:13:09'),
(5, 'twitter-pixel', 'pixels', 'Twitter Pixel', '<p>Conversion tracking for websites enables you to measure your return on investment by tracking the actions users take after viewing or engaging with your ads on Twitter.</p><p><code>e.g. 123456789</code></p><p><a href=\"https://business.twitter.com/en/help/campaign-measurement-and-analytics/conversion-tracking-for-websites.html\" target=\"_blank\">Learn more</a></p>', 0, '2022-06-15 21:13:09'),
(6, 'adroll-pixel', 'pixels', 'AdRoll Pixel', '<p>The AdRoll Pixel is uniquely generated when you create an AdRoll account. The AdRoll ID has two components: the Advertiser ID or adroll_adv_id (X) and Pixel ID or adroll_pix_id (Y) for the AdRoll Pixel. To use the AdRoll Pixel, merge the two components together, separating them by a slash (/).</p><p><code>e.g. adroll_adv_id/adroll_pix_id</code></p><p><a href=\"https://help.adroll.com/hc/en-us/articles/211846018\" target=\"_blank\">Learn more</a></p>', 0, '2022-06-15 21:13:09'),
(7, 'quora-pixel', 'pixels', 'Quora Pixel Pixel', '<p>The Quora Pixel is a tool that is placed in your website code to track traffic and conversions. When someone clicks on your ad and lands on your website, the Quora Pixel allows you to identify how many people are visiting your website and what actions they are taking.</p><p><code>e.g. 1a79a4d60de6718e8e5b326e338ae533</code></p><p><a href=\"https://quoraadsupport.zendesk.com/hc/en-us/articles/115010466208-How-do-I-install-the-Quora-pixel-\" target=\"_blank\">Learn more</a></p>', 0, '2022-06-15 21:13:09'),
(8, 'can-i-upgrade-my-account-at-any-time', 'subscription', ' Can I upgrade my account at any time?', '<p>Yes! You can start with our free package and upgrade anytime to enjoy premium features.</p>', 1, '2022-06-15 21:13:09'),
(9, 'how-will-i-be-charged', 'subscription', 'How will I be charged?', '<p>You will be charged at the beginning of each period automatically until canceled.</p>', 1, '2022-06-15 21:13:09'),
(10, 'what-happens-when-i-delete-my-account', 'subscription', 'What happens when I delete my account?', '<p>Once your account has been deleted, your subscription will be canceled and we will wipe all of your data from our servers including but not limited to your links, traffic data, pixels and all other associated data.</p>', 1, '2022-06-15 21:13:09'),
(11, 'how-do-refunds-work', 'subscription', ' How do refunds work?', '<p>Upon request, we will issue a refund at the moment of the request for all <strong>upcoming</strong periods. If you are on a monthly plan, we will stop charging you at the end of your current billing period. If you are on a yearly plan, we will refund amounts for the remaining months.</p>', 1, '2022-06-15 21:13:09');
INSERT INTO `page` (`id`, `name`, `category`, `seo`, `content`, `menu`, `lastupdated`) VALUES
(1, 'Cookie Policy', 'policy', 'cookie-policy', '<style type=\"text/css\">a.cky-banner-element {\r\n        padding: 8px 30px;\r\n        background: #F8F9FA;\r\n        color: #858A8F;\r\n        border: 1px solid #DEE2E6;\r\n        box-sizing: border-box;\r\n        border-radius: 2px;\r\n        cursor: pointer;\r\n}\r\n</style>\r\n<h2 class=\"cookie-policy-h1\">Cookie Policy</h2>\r\n\r\n<p>Effective Date: 14-Sep-2022<br />\r\nLast Updated: 24-nov-2023</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Apa yang dimaksud dengan cookie?</strong></h3>\r\n\r\n<p><br />\r\nKebijakan Cookie ini menjelaskan apa itu cookie dan bagaimana kami menggunakannya, jenis-jenis cookie yang kami gunakan, yaitu informasi yang kami kumpulkan dengan menggunakan cookie dan bagaimana informasi tersebut digunakan, serta cara mengelola pengaturan cookie.</p>\r\n\r\n<p>Cookie adalah file teks kecil yang digunakan untuk menyimpan informasi kecil. Cookie disimpan di perangkat Anda saat situs web dimuat di browser Anda. Cookie ini membantu kami membuat situs web berfungsi dengan baik, membuatnya lebih aman, memberikan pengalaman pengguna yang lebih baik, dan memahami bagaimana kinerja situs web serta menganalisis apa yang berhasil dan apa yang perlu ditingkatkan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Bagaimana kami menggunakan cookie?</strong></h3>\r\n\r\n<p><br />\r\nSeperti kebanyakan layanan online lainnya, situs web kami menggunakan cookie pihak pertama dan pihak ketiga untuk beberapa tujuan. Cookie pihak pertama sebagian besar diperlukan agar situs web berfungsi dengan baik, dan cookie ini tidak mengumpulkan data pribadi Anda.</p>\r\n\r\n<p>Cookie pihak ketiga yang digunakan di situs web kami terutama untuk memahami bagaimana kinerja situs web, bagaimana Anda berinteraksi dengan situs web kami, menjaga keamanan layanan kami, menyediakan iklan yang relevan bagi Anda, dan secara keseluruhan memberi Anda pengalaman pengguna yang lebih baik dan lebih baik serta membantu mempercepat interaksi Anda di masa depan dengan situs web kami.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Jenis Cookie yang kami gunakan</strong></h3>\r\n\r\n<p><br />\r\nAnda dapat mengubah preferensi cookie Anda kapan saja dengan mengeklik tombol di atas. Ini akan memungkinkan Anda untuk mengunjungi kembali spanduk persetujuan cookie dan mengubah preferensi Anda atau menarik persetujuan Anda segera.</p>\r\n\r\n<p>Selain itu, browser yang berbeda menyediakan metode yang berbeda untuk memblokir dan menghapus cookie yang digunakan oleh situs web. Anda dapat mengubah pengaturan browser Anda untuk memblokir/menghapus cookie. Di bawah ini adalah tautan ke dokumen dukungan tentang cara mengelola dan menghapus cookie dari browser web utama.</p>\r\n\r\n<p>Chrome:&nbsp;<a href=\"https://support.google.com/accounts/answer/32050\" target=\"_blank\">https://support.google.com/accounts/answer/32050</a></p>\r\n\r\n<p>Safari:&nbsp;<a href=\"https://support.apple.com/en-in/guide/safari/sfri11471/mac\" target=\"_blank\">https://support.apple.com/en-in/guide/safari/sfri11471/mac</a></p>\r\n\r\n<p>Firefox:&nbsp;<a href=\"https://support.mozilla.org/en-US/kb/clear-cookies-and-site-data-firefox?redirectslug=delete-cookies-remove-info-websites-stored&amp;redirectlocale=en-US\" target=\"_blank\">https://support.mozilla.org/en-US/kb/clear-cookies-and-site-data-firefox?redirectslug=delete-cookies-remove-info-websites-stored&amp;redirectlocale=en-US</a></p>\r\n\r\n<p>Internet Explorer:&nbsp;<a href=\"https://support.microsoft.com/en-us/topic/how-to-delete-cookie-files-in-internet-explorer-bca9446f-d873-78de-77ba-d42645fa52fc\" target=\"_blank\">https://support.microsoft.com/en-us/topic/how-to-delete-cookie-files-in-internet-explorer-bca9446f-d873-78de-77ba-d42645fa52fc</a></p>\r\n\r\n<p>Jika Anda menggunakan browser web lainnya, silakan kunjungi dokumen dukungan resmi browser Anda.</p>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2023-11-24 06:51:20'),
(2, 'Privacy Policy', 'policy', 'privacy-policy', '<h2 class=\"privacy-policy-h1\">Privacy Policy</h2>\r\n\r\n<p class=\"privacy-policy-h1\"><br />\r\n<span>Last Updated On 14-Sep-2022</span><br />\r\n<span>Effective Date 14-Sep-2022</span></p>\r\n\r\n<p>Kebijakan Privasi ini menjelaskan kebijakan Url Shortener yang dikelola oleh kelompok 1, email: phionix32@protonmail.com, mengenai pengumpulan, penggunaan dan pengungkapan informasi Anda yang kami kumpulkan ketika Anda menggunakan situs web kami (localhost). (&quot;Layanan&quot;). Dengan mengakses atau menggunakan Layanan, Anda menyetujui pengumpulan, penggunaan, dan pengungkapan informasi Anda sesuai dengan Kebijakan Privasi ini. Jika Anda tidak menyetujui hal yang sama, mohon untuk tidak mengakses atau menggunakan Layanan.</p>\r\n\r\n<p>Kami dapat mengubah Kebijakan Privasi ini kapan saja tanpa pemberitahuan sebelumnya kepada Anda dan akan memposting Kebijakan Privasi yang telah direvisi pada Layanan. Kebijakan yang direvisi akan berlaku efektif 180 hari sejak Kebijakan yang direvisi diposting di Layanan dan akses atau penggunaan Anda yang berkelanjutan atas Layanan setelah waktu tersebut merupakan penerimaan Anda atas Kebijakan Privasi yang direvisi. Oleh karena itu, kami menyarankan Anda untuk meninjau halaman ini secara berkala.</p>\r\n\r\n<ol class=\"privacy-policy-ol\">\r\n	<li>\r\n	<h3 class=\"privacy-policy-h2\">Information We Collect:</h3>\r\n\r\n	<p class=\"privacy-policy-p\">Kami akan mengumpulkan dan memproses informasi pribadi berikut tentang Anda:</p>\r\n\r\n	<ol class=\"privacy-policy-ol\">\r\n		<li>Nama</li>\r\n		<li>Email</li>\r\n		<li>Social Media Profile</li>\r\n		<li>Date of Birth</li>\r\n	</ol>\r\n	</li>\r\n	<li>\r\n	<h3 class=\"privacy-policy-h2\">How We Use Your Information:</h3>\r\n\r\n	<p class=\"privacy-policy-p\">Kami akan menggunakan informasi yang kami kumpulkan tentang Anda untuk tujuan berikut:</p>\r\n\r\n	<ol class=\"privacy-policy-ol\">\r\n		<li>Marketing/ Promotional</li>\r\n		<li>Customer feedback collection</li>\r\n		<li>Targeted advertising</li>\r\n		<li>Site protection</li>\r\n	</ol>\r\n\r\n	<p class=\"privacy-policy-p\">Jika kami ingin menggunakan informasi Anda untuk tujuan lain, kami akan meminta persetujuan Anda dan akan menggunakan informasi Anda hanya setelah menerima persetujuan Anda dan kemudian, hanya untuk tujuan(-tujuan) yang memberikan persetujuan kecuali jika kami diwajibkan untuk melakukan hal lain oleh hukum.</p>\r\n	</li>\r\n	<li>\r\n	<h3 class=\"privacy-policy-h2\">How We Share Your Information:</h3>\r\n\r\n	<p class=\"privacy-policy-p\">Kami tidak akan mentransfer informasi pribadi Anda kepada pihak ketiga mana pun tanpa meminta persetujuan Anda, kecuali dalam keadaan terbatas seperti yang dijelaskan di bawah ini:</p>\r\n\r\n	<ol class=\"privacy-policy-ol\">\r\n		<li>Ad service</li>\r\n		<li>Sponsors</li>\r\n		<li>Marketing agencies</li>\r\n		<li>Analytics</li>\r\n	</ol>\r\n\r\n	<p>Kami mewajibkan pihak ketiga tersebut untuk menggunakan informasi pribadi yang kami transfer kepada mereka hanya untuk tujuan transfer dan tidak menyimpannya lebih lama dari yang diperlukan untuk memenuhi tujuan tersebut.</p>\r\n\r\n	<p>Kami juga dapat mengungkapkan informasi pribadi Anda untuk hal-hal berikut: (1) untuk mematuhi hukum, peraturan, perintah pengadilan, atau proses hukum lainnya yang berlaku; (2) untuk menegakkan perjanjian Anda dengan kami, termasuk Kebijakan Privasi ini; atau (3) untuk menanggapi klaim bahwa penggunaan Layanan oleh Anda melanggar hak-hak pihak ketiga. Jika Layanan atau perusahaan kami bergabung atau diakuisisi dengan perusahaan lain, informasi Anda akan menjadi salah satu aset yang dialihkan kepada pemilik baru.</p>\r\n	</li>\r\n	<li>\r\n	<h3 class=\"privacy-policy-h2\">Retention Of Your Information:</h3>\r\n\r\n	<p class=\"privacy-policy-p\">Kami akan menyimpan informasi pribadi Anda bersama kami selama 90 hari hingga 2 tahun setelah pengguna mengakhiri akun mereka atau selama kami membutuhkannya untuk memenuhi tujuan pengumpulan informasi tersebut seperti yang dijelaskan dalam Kebijakan Privasi ini. Kami mungkin perlu menyimpan informasi tertentu untuk jangka waktu yang lebih lama seperti pencatatan/pelaporan sesuai dengan hukum yang berlaku atau untuk alasan yang sah lainnya seperti penegakan hak-hak hukum, pencegahan penipuan, dll. Informasi anonim sisa dan informasi agregat, yang tidak ada yang mengidentifikasi Anda (secara langsung atau tidak langsung), dapat disimpan tanpa batas waktu.</p>\r\n	</li>\r\n	<li>\r\n	<h2 class=\"privacy-policy-h2\">Your Rights:</h2>\r\n\r\n	<p>Bergantung pada hukum yang berlaku, Anda mungkin memiliki hak untuk mengakses dan memperbaiki atau menghapus data pribadi Anda atau menerima salinan data pribadi Anda, membatasi atau menolak pemrosesan data Anda secara aktif, meminta kami untuk membagikan (memberikan) informasi pribadi Anda kepada entitas lain, menarik persetujuan yang Anda berikan kepada kami untuk memproses data Anda, hak untuk mengajukan keluhan kepada otoritas hukum dan hak-hak lain yang mungkin relevan berdasarkan hukum yang berlaku. Untuk menggunakan hak-hak ini, Anda dapat mengirim surat kepada kami di phionix32@protonmail.com. Kami akan menanggapi permintaan Anda sesuai dengan hukum yang berlaku.</p>\r\n\r\n	<p>Anda dapat memilih untuk tidak menerima komunikasi pemasaran langsung atau pembuatan profil yang kami lakukan untuk tujuan pemasaran dengan mengirimkan surat kepada kami di phionix32@protonmail.com.</p>\r\n\r\n	<p>Harap diperhatikan bahwa jika Anda tidak mengizinkan kami untuk mengumpulkan atau memproses informasi pribadi yang diperlukan atau menarik persetujuan untuk memproses informasi yang sama untuk tujuan yang diperlukan, Anda mungkin tidak dapat mengakses atau menggunakan layanan yang informasinya diminta.</p>\r\n	</li>\r\n	<li>\r\n	<h3 class=\"privacy-policy-h2\">Cookies Etc.</h3>\r\n\r\n	<p class=\"privacy-policy-p\">Untuk mempelajari lebih lanjut tentang cara kami menggunakan teknologi ini dan pilihan Anda terkait teknologi pelacakan ini, silakan lihat <a href=\"https://piliruma.co.id/link/page/cookie-policy\">Cookie Policy.</a></p>\r\n	</li>\r\n	<li>\r\n	<h3 class=\"privacy-policy-h2\">Security:</h3>\r\n\r\n	<p class=\"privacy-policy-p\">Keamanan informasi Anda penting bagi kami dan kami akan menggunakan langkah-langkah keamanan yang wajar untuk mencegah kehilangan, penyalahgunaan, atau perubahan yang tidak sah atas informasi Anda yang berada di bawah kendali kami. Namun demikian, mengingat risiko yang melekat, kami tidak dapat menjamin keamanan mutlak dan karenanya, kami tidak dapat memastikan atau menjamin keamanan informasi apa pun yang Anda kirimkan kepada kami dan Anda melakukannya dengan risiko Anda sendiri.</p>\r\n	</li>\r\n	<li>\r\n	<h3 class=\"privacy-policy-h2\">Third Party Links &amp; Use Of Your Information:</h3>\r\n\r\n	<p class=\"privacy-policy-p\">Layanan kami mungkin berisi tautan ke situs web lain yang tidak dioperasikan oleh kami. Kebijakan Privasi ini tidak membahas kebijakan privasi dan praktik-praktik lain dari pihak ketiga mana pun, termasuk pihak ketiga mana pun yang mengoperasikan situs web atau layanan apa pun yang dapat diakses melalui tautan pada Layanan. Kami sangat menyarankan Anda untuk meninjau kebijakan privasi setiap situs yang Anda kunjungi. Kami tidak memiliki kendali atas dan tidak bertanggung jawab atas konten, kebijakan privasi, atau praktik situs atau layanan pihak ketiga mana pun.</p>\r\n	</li>\r\n	<li>\r\n	<h3 class=\"privacy-policy-h2\">Grievance / Data Protection Officer:</h3>\r\n\r\n	<p class=\"privacy-policy-p\">Jika Anda memiliki pertanyaan atau kekhawatiran tentang pemrosesan informasi Anda yang tersedia pada kami, Anda dapat mengirim email kepada Petugas Keluhan kami di&nbsp;email: phionix32@protonmail.com. Kami akan menangani masalah Anda sesuai dengan hukum yang berlaku.</p>\r\n	</li>\r\n</ol>\r\n\r\n<p class=\"privacy-policy-p\">Privacy Policy generated with <a href=\"https://www.cookieyes.com/?utm_source=PP&amp;utm_medium=footer&amp;utm_campaign=UW\" target=\"_blank\">CookieYes</a>.</p>\r\n', 1, '2023-11-24 06:55:33');
